export default function NewItemForm(props) {
    return (
        <div className="new-item-form">
            <form onSubmit={props.onSubmit}>
                <div>
                    {/* Label */}
                    <label htmlFor="name">Name</label>

                    {/* Input */}
                    <input
                        type="text"
                        name="name"
                        id="name"
                        placeholder={props.placeholder}

                        // use this
                        value={props.value}
                        onChange={props.onChange}
                    />
                </div>

                <div>
                    {/* Button */}
                    <input
                        type="submit"
                        value="Create"
                    />
                </div>
            </form>
        </div>
    )
}
